const INITIAL_STATE = {
    sections: [
        {
            title: 'Pocket Operators',
            route: 'po',
            imageUrl: 'images/nicolas-nowak-pocket-operators.jpg',
            id: 1,
            linkUrl: 'shop/po'
        },
        {
            title: 'Synths',
            route: 'synths',
            imageUrl: 'images/synths.jpg',
            id: 2,
            linkUrl: 'shop/synths'
        }
    ]
};

const directoryReducer = (state = INITIAL_STATE, action) => {
    switch(action.type) {
        default:
            return state;
    }
};

export default directoryReducer;
